import React from 'react'
import { useNavigation } from '@react-navigation/native'
import { Text, View, TextInput, TouchableOpacity } from 'react-native'
import { Entypo } from '@expo/vector-icons';

import styles from '../Logon/styles'

export default function Logon() {
  const navigation = useNavigation();

  function incidentList() {
    navigation.navigate('Incidents')
  }

  function newOng() {
    navigation.navigate('newOng');
  }

  return(
    <View style={styles.container}>
      <Text style={styles.title}>Faça seu Login</Text>

      <View style={styles.login}>
        <TextInput 
          style={styles.textInput}
          placeholder="Sua ID"
        />
      </View>

      <View style={styles.action}>
        <TouchableOpacity style={styles.loginAction} onPress={() => incidentList()}>
          <Text style={styles.actionText}>Entrar</Text>
        </TouchableOpacity>
      </View>

      <TouchableOpacity
        style={styles.detailsButton}
        onPress={() => newOng()}
      >
      <Entypo name="login" size={16} color="#E02041"></Entypo>
      <Text style={styles.detailsButtonText}>Não tenho cadastro</Text>
      </TouchableOpacity>
    </View>
  )
}
